dynamicObject = {
  data: { count: 0 },

  ['get' + 'Count']() {
    function getCurrentCount() {
      return this.data.count;
    }
    return getCurrentCount.call(this);
  },

  ['set' + 'Count'](value) {
    function updateCount() {
      this.data.count = value;
    }
    updateCount.call(this);
    return this;
  }
}

